import React, { useState } from "react";
import envelope from "../images/envelope.svg";
import sos from "../images/sos.svg";
import write from "../images/write.svg";
import "../global.css";
import { Link, withRouter } from "react-router-dom";
import { NavContainer } from "./Nav.style.js";

function Navbar(props) {
  return (
    <NavContainer>
      <div className="nav">
        <Link to="/messages">
          <img src={envelope} alt="envelope" className="icon"></img>
          <p className="icon-text">Messages</p>
        </Link>
        <Link to="/write">
          <img src={write} alt="write" className="icon"></img>
          <div className="icon-text">Write</div>
        </Link>
        <Link to="/emergency">
          <img src={sos} alt="emergency" className="icon"></img>
          <div className="icon-text">Emergency</div>
        </Link>
      </div>
    </NavContainer>
  );
}

export default Navbar;
